  "text" : "\uB9CE\uC740 \uC2DC\uAC04\uACFC \uB178\uB825\uC744 \uB4E4\uC600\uB2E4. \uB3D9\uC2DC\uC5D0 \uC0AC\uC6A9\uC790\uB4E4\uC774 \uAC80\uC0C9 \uC2DC \uC0AC\uC6A9\uD560 \uC218 \uC788\uB294 \uB2E4\uC591\uD55C \uB0A0\uC9DC \uAD00\uB828 \uC785\uB825\uC5B4\uB4E4\uC5D0 \uB300\uD574\uC11C\uB3C4 \uB9CE\uC774 \uACE0\uBBFC\uD588\uB2E4. \uD604\uC2DC\uC810\uC5D0\uC11C\uB294 \uC0AC\uC6A9\uC790\uB4E4\uC774 \uCE74\uC57D \uBD07\uC5D0 \uB300\uD574 \uBCC4\uB3C4\uB85C \uC0AC\uC6A9\uBC95\uC744 \uC775\uD788\uC9C0 \uC54A\uC544\uB3C4 \uC6D0\uD65C\uD558\uAC8C \uC18C\uD1B5\uD560 \uC218 \uC788\uB2E4.",
