  "text" : "\uC5EC\uD589 \uAD00\uB828 \uB3C4\uBA54\uC778\uC5D0\uC11C \uAC00\uC7A5 \uC911\uC694\uD55C \uC785\uB825\uC5B4\uB294 \uC7A5\uC18C\uC640 \uB0A0\uC9DC \uB450 \uAC00\uC9C0\uB77C\uACE0 \uBCFC \uC218 \uC788\uB2E4. \uCE74\uC57D\uC740 \uC804 \uC138\uACC4 \uC218\uBC31\uB9CC \uAC1C\uC758 \uB3C4\uC2DC, \uACF5\uD56D, \uD638\uD154 \uB4F1\uC758 \uC815\uBCF4\uAC00 \uD3EC\uD568\uB41C \uC790\uC0AC \uBCF4\uC720 \uB370\uC774\uD130\uBCA0\uC774\uC2A4 \uB3C5\uB9BD\uCCB4\uB97C \uC790\uCCB4\uC801\uC73C\uB85C \uAC1C\uBC1C\uD55C NLP \uC5D4\uC9C4\uACFC \uD1B5\uD569\uD558\uB294\uB370 (\uC774\uC5B4\uC11C)",
