  "text" : "RT @V4K: \"\uB300\uD559 \uC2DC\uC808\uBD80\uD130 \uC624\uB514\uC158\uC744 \uBD24\uB2E4. \uC815\uB2F9\uD558\uAC8C \uAE30\uD68C\uB97C \uB530\uB0B4\uACE0 \uB204\uB9B4 \uC904 \uC54C\uC558\uB294\uB370, \uADF8\uB7F0 \uC2DC\uC2A4\uD15C\uC774 \uC544\uB2C8\uB77C \uC5EC\uC131\uC73C\uB85C\uC11C \uAC10\uB3C5\uC774\uB098 \uC81C\uC791\uC790\uB4E4\uC5D0\uAC8C \uC5B4\uD544\uD574\uC57C \uD558\uB294 \uAC8C \uC18D\uC0C1\uD588\uB2E4. \uBC24\uC5D0 \uD56D\uC0C1 \uC220\uC790\uB9AC\uC5D0 \uBD88\uB800\uB2E4. \uC774\uB7F0 \uAD00\uD589\uB4E4\uC774 \uC2EB\uC5B4 \uD504\uB791\uC2A4 \uC720\uD559\uC744 \uACB0\uC2EC\uD588\uB2E4.\"\u2026",
