  "text" : "EDM \uC2A4\uD0C0\uC77C\uC758 \uC74C\uC545\uC744 \uCD94\uAD6C\uD558\uB294 \uADF8\uB8F9\uC774\uB77C \uD2B9\uBCC4\uD788 \uC774 \uACE1\uC744 \uACE0\uB97C \uAC70\uB77C \uC0DD\uAC01\uD558\uC9C0 \uC54A\uC558\uB2E4. \uADF8\uB798\uC11C \uB9C8\uCE68\uB0B4 f(x)\uAC00 \uC774 \uACE1\uC744 \uBD80\uB974\uAE30\uB85C \uACB0\uC815\uD588\uB2E4\uACE0 \uD588\uC744 \uB54C \uC0B4\uC9DD \uB180\uB790\uB2E4. \uC804\uCCB4\uC801\uC778 \uB290\uB08C\uC740 \uC544\uB9AC\uB098\uC544 \uADF8\uB780\uB370 \uAC19\uC740 \uAC00\uC218\uAC00 \uBD80\uB974\uBA74 \uC5B4\uC6B8\uB9B4 \uB9CC\uD55C \uC74C\uC545\uC744 \uC0DD\uAC01\uD574\uBD24\uB2E4.",
