  "text" : "\uB2E4\uB978 \uC0AC\uB78C\uC740 \uC5B4\uB5A8\uC9C0 \uBAA8\uB974\uACA0\uC9C0\uB9CC \uB0B4 \uACBD\uC6B0 \uACF5\uB3D9\uC791\uC5C5\uC744 \uD558\uB294 \uAC74 \uAC70\uC758 \uC778\uAC04\uC801\uC778 \uC774\uC720 \uB54C\uBB38\uC774\uB2E4. \uC0AC\uB78C\uB4E4\uACFC \uC774\uC57C\uAE30\uD558\uACE0 \uAD50\uB958\uD558\uBA74\uC11C \uC74C\uC545\uC744 \uD558\uB294 \uBC29\uC2DD\uC744 \uC120\uD638\uD558\uAE30 \uB54C\uBB38\uC774\uB2E4. \uB610 \uD558\uB098\uC758 \uC774\uC720\uB294 \uB098\uB294 \uBCF4\uB2E4 \uC815\uD1B5\uC801\uC778 \uC791\uACE1\uAC00\uC774\uB2E4 \uBCF4\uB2C8 \uCEF4\uD4E8\uD130\uB098 \uAE30\uC220\uC801\uC778 \uBD80\uBD84\uC744 (\uC774\uC5B4\uC11C)",
