  "text" : "\uC624\uBC84\uADF8: \uC7AC\uBC0C\uB294 \uC774\uC57C\uAE30\uAC00 \uD558\uB098 \uC788\uB2E4. \u3008\uC720\uB85C\uBE44\uC804 \uC1A1 \uCF58\uD14C\uC2A4\uD2B8\u3009 \uB77C\uACE0 \uB9E4\uB144 \uC5F4\uB9AC\uB294 \uC74C\uC545 \uB300\uD68C\uAC00 \uC788\uB2E4. \uC774 \uCF58\uD14C\uC2A4\uD2B8\uC758 \uC74C\uC545 \uC2A4\uD0C0\uC77C\uC740 \uBB3C\uB860 \uB298 \uBC14\uB00C\uC5B4 \uC654\uC9C0\uB9CC \uD2B9\uD788 80-90\uB144\uB300\uC5D0 \uC720\uD589\uD55C \uC720\uB85C\uBE44\uC804\uC758 \uC74C\uC545\uB4E4\uC740 \uC81C\uC774\uD31D\uC758 \uBCF4\uC774\uBC34\uB4DC \uC74C\uC545\uACFC \uAD49\uC7A5\uD55C \uC720\uC0AC\uC131\uC774 \uC788\uB2E4.",
